    recently. The first was from Rush Holt for Congress. We had made a contribution
    for his Primary 2012 but the campaign lost the check. When contacted late in October
    of 2012, we re-issued a check but they did not cash it in time before the elections.
    They did cash the check but issued a refund. The second is Schweikert for Congress.
    We made a contribution for this campaigns 2012 Debt Retirement however they no
    longer had debt and refunded our contribution.\n"
